import axios from 'axios';

const STUDENT_API_BASE_URL = "http://localhost:8443/students";
const AuthStr = "eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiIxOTQ2NDA4NjE2IiwiZXhwIjoxNzI1ODY2NDg5LCJpYXQiOjE3MjU4NjU4ODl9.3yJ12mlyB7ZPkBq5l9gGWCtdzUwi7Iab_VnBUZv_VlTOaDrh11GBLvRA7X2CLnQAIWN0eX8ZAkIWOFVSV2TkXw";

export const getStudents = () => {
    return axios.get(STUDENT_API_BASE_URL
        ,{ 'headers': { 'Authorization': AuthStr } }
    );
}
